import React from 'react';
import FormField from '@cloudscape-design/components/form-field';
import FileUpload from '@cloudscape-design/components/file-upload';
import TopNavigation from '@cloudscape-design/components/top-navigation';
import Button from "@cloudscape-design/components/button";

const containerStyle = {
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  height: '100vh',
};

const uploadBoxStyle = {
  width: '300px',
  height: '200px',
  border: '2px dashed #ddd',
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  flexDirection: 'column',
};

const SubmitButton = () => {
  return <Button variant="primary">Submit</Button>;
};

export default function App(props) {
  // FileUploadComponent
  const [value, setValue] = React.useState([]);

  // TopNavigationComponent
  const topNavigationUtilities = [
    // ... utilities data here ...
  ];

  return (
    <div>
      {/* TopNavigationComponent */}
      <TopNavigation
        identity={{
          href: "#",
          title: "Face2Alias",
          logo: {
            src:
              "data:image/svg+xml;base64,",
            alt: "Face2Alias"
          }
        }}
        utilities={topNavigationUtilities}
      />

      {/* FileUploadComponent */}
      <div style={containerStyle}>
        <div style={uploadBoxStyle}>
          <FormField
            label="Form field label"
            description="Description"
          >
            <FileUpload
              onChange={({ detail }) => setValue(detail.value)}
              value={value}
              i18nStrings={{
                uploadButtonText: e =>
                  e ? "Choose files" : "Choose file",
                dropzoneText: e =>
                  e
                    ? "Drop files to upload"
                    : "Drop file to upload",
                removeFileAriaLabel: e =>
                  `Remove file ${e + 1}`,
                limitShowFewer: "Show fewer files",
                limitShowMore: "Show more files",
                errorIconAriaLabel: "Error"
              }}
              showFileLastModified
              showFileSize
              showFileThumbnail
              tokenLimit={3}
              constraintText="Hint text for file requirements"
            />
          </FormField>
          {/* Render the new SubmitButton component */} // what it means 
          <SubmitButton />
        </div>
      </div>
    </div>
  );
}
